**Expected behavior**
the same input should have the same output.

**Describe the bug**
I trained an image classification model(single tag per image) using Microsoft CustomVision and exported the model in Onnx format. I then created a .Net 5 Console App written in C#, to use the model for inferencing a large number of image samples and measure performance, my key performance metric is inferencing time(ms) per image. 

I have the following packages installed:
 
